export default function PostList() {
    //console.log('start')
    const posts = useFetch('/posts')
    return(
        <>test
            <ul>
            {posts.map(post => (
                <li key={post.id}>
                <Link href="/posts/[id]" as={`/posts/${post.id}`}>
                    <a>{post.title}</a>
                </Link>
                </li>
            ))}              
            </ul>
        </>

    )
}
